.tab-bar {
  height: 34px;
  background: #2d2d2d;
}
.tab-bar:after {
  content: "";
  position: absolute;
  bottom: 0;
  height: 5px;
  left: 0px;
  width: 100%;
  background-color: #222222;
}
.tab-bar .tab {
  position: relative;
  top: 5px;
  max-width: 160px;
  height: 24px;
  line-height: 24px;
  padding: 0;
  margin: 0 20px 0 5px;
  color: #bebebe;
  transition: color 0.1s ease-in;
}
.tab-bar .tab,
.tab-bar .tab:before,
.tab-bar .tab:after {
  background: #2d2d2d;
  height: 24px;
}
.tab-bar .tab:hover,
.tab-bar .tab:hover:before,
.tab-bar .tab:hover:after {
  background-color: #414141;
  transition: background-color 0.1s ease-in;
  z-index: 1;
}
.tab-bar .tab:before,
.tab-bar .tab:after {
  content: '';
  position: absolute;
  top: 0px;
  width: 25px;
  height: 24px;
}
.tab-bar .tab:before {
  left: -14px;
  border-top-left-radius: 3px;
  -webkit-transform: skewX(-30deg);
}
.tab-bar .tab:after {
  right: -14px;
  border-top-right-radius: 3px;
  -webkit-transform: skewX(30deg);
}
.tab-bar .tab .close-icon {
  right: 0;
  z-index: 3;
  text-align: right;
  line-height: 24px;
  color: #2d2d2d;
}
.tab-bar .tab .close-icon:hover {
  color: inherit;
}
.tab-bar .tab.modified:not(:hover) .close-icon {
  border-color: #2d2d2d;
  right: 0;
  top: 9px;
  width: 8px;
  height: 8px;
}
.tab-bar .tab.modified:hover .close-icon {
  color: #2d2d2d;
}
.tab-bar .tab.modified:hover .close-icon:hover {
  color: #66cccc;
}
.tab-bar .tab.modified .title {
  color: #8cd9d9;
}
.tab-bar .tab .title {
  position: relative;
  z-index: 1;
  padding-right: 10px;
}
.tab-bar .tab:first-child {
  margin-left: 20px;
}
.tab-bar .tab.active {
  z-index: 1;
  color: #ffffff;
}
.tab-bar .tab.active .close-icon {
  line-height: 23px;
  color: #bebebe;
}
.tab-bar .tab.active,
.tab-bar .tab.active:before,
.tab-bar .tab.active:after {
  background: #222222;
  height: 25px;
}
.tab-bar .tab.active:before {
  left: -14px;
  border-top-left-radius: 3px;
  -webkit-transform: skewX(-30deg);
}
.tab-bar .tab.active.modified .close-icon {
  border-color: #66cccc;
  color: #66cccc;
}
.tab-bar .tab.active.modified:hover .close-icon {
  border-color: #66cccc;
  color: #66cccc;
}
.tab-bar .tab.active.modified:hover .close-icon:hover {
  color: #9fdfdf;
}
.tab-bar .tab:hover {
  color: #ffffff;
}
.tab-bar .tab.active:hover .close-icon {
  color: #bebebe;
}
.tab-bar .tab.active:hover .close-icon:hover {
  color: inherit;
}
.tab-bar .placeholder {
  height: 34px;
}
.tab-bar .placeholder:after {
  top: 34px;
}
